import React from "react";
import bgimg from "../../image/bgimg2.jpg";
const Landing = () => {
  return (
    <section className="landing">
      <img
        src={bgimg}
        width="100%"
        height="800px"
        className="d-inline-block align-top"
        alt="backgroundimg"
      />
      <div className="dark-overlay">
        <div className="landing-inner"></div>
      </div>
    </section>
  );
};

export default Landing;
